$("#property").autocomplete({source:function(e,t){$.ajax({url:"/bills/fetch-properties-water.json",data:{name:e.term},dataType:"json",success:function(e){t(e)}})},select:function(e,t){return $("#property").val(t.item.full_address),$("#property-id").val(t.item.id),!1}}).autocomplete("instance")._renderItem=function(e,t){var r={photo:t.main_photo,address:t.full_address,code:t.formatted_code,locator:t.locator.user.nome,locator_username:t.locator.user.formatted_username};return $("<li>").append($("#properties-search-template").tmpl(r)).appendTo(e)},$("#bills-to-pay-list").DataTable({order:[[0,"desc"]],responsive:!0});